DROP TABLE IF EXISTS `offline_message`;

CREATE TABLE `offline_message` (
  `fromId` char(100) NOT NULL DEFAULT '' COMMENT '消息发送者,用户id或者群id',
  `toId` char(100) NOT NULL DEFAULT '' COMMENT '消息接受者',
  `timeStamp` char(100) NOT NULL DEFAULT '' COMMENT '时间戳',
  `lastMessage` text NOT NULL COMMENT '最后最新的一条消息',
  `type` int(11) NOT NULL COMMENT '0-纯文字，1-图片',
  `messageNum` int(11) NOT NULL COMMENT '离线消息数量',
  `senderId` char(100) DEFAULT NULL COMMENT '当该离线消息为群消息时，该值存在，为群中发送消息的具体用户id',
  `chatType` int(11) NOT NULL COMMENT '0-用户id，1-群id',
  PRIMARY KEY (`fromId`,`toId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='存放未接受的离线消息';

